import { Link } from "react-router-dom";

const handleNextClick = () => {

      navigate('/type');
  }

function Main() {
    return (
        <div class="explanation">
            <h1>
                This is our Main page! How about we get started?<br></br>
                If you want to start making trip plans, press the button above!
            </h1>
            <p>
                Planning your next adventure has never been easier. 
                Whether you're dreaming of exotic destinations, thrilling adventures, or a peaceful getaway, we've got you covered. 
                Our user-friendly interface makes it simple to create and organize your perfect trip. 
                Let your wanderlust guide you, and let's turn your travel dreams into reality!
            </p>
            <button onClick={() => handleNextClick} className="start-button">
                Start Planning
            </button>
        </div>
    )
}

export default Main;
